import { BigNumber } from 'ethers';
import { SetupFunctionBase } from '../../utils/SetupFunctionBase';

const script: SetupFunctionBase = new (class extends SetupFunctionBase {
    public forceSetContracts: boolean = false;

    public async runScript(): Promise<boolean | void> {
        await this.unpauseContractIfNeeded('Consumables');
        await this.setAdminsIfNeeded('Consumables',
            this.getContractAddresses('Rift', 'World', 'TrainingProficiency', 'TrainingGame', 'TrainingGrounds', 'Graveyard')
        );

        await this.setupConsumableIdsIfNeeded();
    }

    private async setupConsumableIdsIfNeeded() {
        console.log(`Checking Consumable IDs for changes...`);
        const imgs = [
            {"name":"Elixir of Health",
            "png":""},
            {"name":"Iron Helmet",
            "png":""},
            {"name":"Steak",
            "png":""},
            {"name":"Phoenix Down",
            "png":""},
            {"name":"Robe of Metropolis",
            "png":""},
            {"name":"Item of Many Mysteries",
             "png":""},
        ];
        for(var i = 1; i <= 6; i++) {
            let typeInfo = await this.deployments?.read('Consumables', `typeInfo`, i);
            let imgInfo = await this.deployments?.read('Consumables', `traitData`, i);
            if(typeInfo.maxSupply.eq(0)) {
                await this.deployments?.execute(
                    'Consumables',
                    { from: this.deployer, log: true },
                    `setType`,
                    i,
                    BigNumber.from("0xffffffffffffffffffffffffffffffff")
                );
            }
            if(imgInfo.name != imgs[i - 1].name || imgInfo.png != imgs[i - 1].png) {
                await this.deployments?.execute(
                    'Consumables',
                    { from: this.deployer, log: true },
                    `uploadImage`,
                    i,
                    imgs[i - 1]
                );
            }
        }
        console.log(`Done checking Consumable IDs for changes!`);
    }
});

export default script.setupFunc;
script.setupFunc.tags = ['consumables'];
script.setupFunc.dependencies = [
    'consumables-deploy', 'rift-deploy', 'world-deploy', 'trainingproficiency-deploy',
    'traininggame-deploy', 'traininggrounds-deploy', 'graveyard-deploy'
];
script.setupFunc.runAtTheEnd = true;